,('en','messages:logentry-pagelang-pagelang','s:57:\"$1 {{GENDER:$2|changed}} the language of $3 from $4 to $5\";'),('en','messages:default-skin-not-found','s:1658:\"Whoops! The default skin for your wiki, defined in <code dir=\"ltr\">$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYour installation seems to include the following {{PLURAL:$4|skin|skins}}. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable {{PLURAL:$4|it|them and choose the default}}.\n\n$2\n\n; If you have just installed MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following {{PLURAL:$5|line|lines}} into <code>LocalSettings.php</code> to enable {{PLURAL:$5|the|all}} installed {{PLURAL:$5|skin|skins}}:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1178:\"Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\n\";'),('en','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (enabled)\";'),('en','messages:default-skin-not-found-row-disabled','s:50:\"* <code>$1</code> / $2 (<strong>disabled</strong>)\";'),('en','messages:mediastatistics','s:16:\"Media statistics\";'),('en','messages:mediastatistics-summary','s:138:\"Statistics about uploaded file types. This only includes the most recent version of a file. Old or deleted versions of files are excluded.\";'),('en','messages:mediastatistics-nfiles','s:8:\"$1 ($2%)\";'),('en','messages:mediastatistics-nbytes','s:40:\"{{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%)\";'),('en','messages:mediastatistics-bytespertype','s:75:\"Total file size for this section: {{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%).\";'),('en','messages:mediastatistics-allbytes','s:67:\"Total file size for all files: {{PLURAL:$1|$1 byte|$1 bytes}} ($2).\";'),('en