[$2]] which is a separate website.\n\n[$1 Click here to continue on to $1].\";'),('en','messages:undelete-cantedit','s:71:\"You cannot undelete this page as you are not allowed to edit this page.\";'),('en','messages:undelete-cantcreate','s:118:\"You cannot undelete this page as there is no existing page with this name and you are not allowed to create this page.\";'),('en','messages:apihelp-main-description','s:1122:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailing list]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> All features shown on this page should be working, but the API is still in active development, and may change at any time. Subscribe to [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<strong>Testing:</strong> For ease of testing API requests, see [[Special:ApiSandbox]].\";'),('en','messages:apihelp-main-param-action','s:24:\"Which action to perform.\";'),('en','messages:apihelp-main-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-main-param-maxlag','s:488:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('en','messages:apihelp-main-param-smaxage','s:102:\"Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-maxage','s:101:\"Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-assert','s:100:\"Verify the user is logged in if set to <kbd>user</kbd>, or has the bot user right if <kbd>bot</kbd>.\";'),('en','messages:apihelp-main-param-assertuser','s:42:\"Verify the current user is the named user.\";'),('en','messages:apihelp-main-param-requestid','s:91:\"Any value given here will be included in the response. May be used to distinguish requests.\";'),('en','messages:apihelp-main-param-servedby','s:60:\"Include the hostname that served the request in the results.\";'),('en','messages:apihelp-main-param-curtimestamp','s:44:\"Include the current timestamp in the result.\";'),('en','messages:apihelp-main-param-responselanginfo','s:89:\"Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),('en','messages:apihelp-main-param-origin','s:1009:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is whitelisted, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),('en','messages:apihelp-main-param-uselang','s:322:\"Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),('en','messages:apihelp-main-param-errorformat','s:349:\"Format to use for warning and error text output.\n; plaintext: Wikitext with HTML tags removed and entities replaced.\n; wikitext: Unparsed wikitext.\n; html: HTML.\n; raw: Message key and parameters.\n; none: No text output, only the error codes.\n; bc: Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),('en','messages:apihelp-main-param-errorlang','s:336:\"Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>content</kbd> to use this wiki\'s content language, or specify <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),('en','messages:apihelp-main-param-errorsuselocal','s:95:\"If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.\";'),('en','messages:apihelp-block-description','s:13:\"Block a user.\";'),('en','messages:apihelp-block-param-user','s:100:\"Username, IP address, or IP address range to block. Cannot be used together with <var>$1userid</var>\";'),('en','messages:apihelp-block-param-userid','s:65:\"User ID to block. Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-block-param-expiry','s:233:\"Expiry time. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.\";'),('en','messages:apihelp-block-param-reason','s:17:\"Reason for block.\";'),('en','messages:apihelp-block-param-anononly','s:78:\"Block anonymous users only (i.e. disable anonymous edits for this IP address).\";'),('en','messages:apihelp-block-param-nocreate','s:25:\"Prevent account creation.\";'),('en','messages:apihelp-block-param-autoblock','s:101:\"Automatically block the last used IP address, and any subsequent IP addresses they try to login from.\";'),('en','messages:apihelp-block-param-noemail','s:95:\"Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).\";'),('en','messages:apihelp-block-param-hidename','s:81:\"Hide the username from the block log. (Requires the <code>hideuser</code> right).\";'),('en','messages:apihelp-block-param-allowusertalk','s:142:\"Allow the user to edit their own talk page (depends on <var>[[mw:Special:MyLanguage/Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('en','messages:apihelp-block-param-reblock','s:61:\"If the user is already blocked, overwrite the existing block.\";'),('en','messages:apihelp-block-param-watchuser','s:53:\"Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-block-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-block-example-ip-simple','s:89:\"Block IP address <kbd>192.0.2.5</kbd> for three days with reason <kbd>First strike</kbd>.\";'),('en','messages:apihelp-block-example-user-complex','s:127:\"Block user <kbd>Vandal</kbd> indefinitely with reason <kbd>Vandalism</kbd>, and prevent new account creation and email sending.\";'),('en','messages:apihelp-changeauthenticationdata-description','s:48:\"Change authentication data for the current user.\";'),('en','messages:apihelp-changeauthenticationdata-example-password','s:76:\"Attempt to change the current user\'s password to <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-checktoken-description','s:104:\"Check the validity of a token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('en','messages:apihelp-checktoken-param-type','s:27:\"Type of token being tested.\";'),('en','messages:apihelp-checktoken-param-token','s:14:\"Token to test.\";'),('en','messages:apihelp-checktoken-param-maxtokenage','s:45:\"Maximum allowed age of the token, in seconds.\";'),('en','messages:apihelp-checktoken-example-simple','s:45:\"Test the validity of a <kbd>csrf</kbd> token.\";'),('en','messages:apihelp-clearhasmsg-description','s:57:\"Clears the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clearhasmsg-example-1','s:56:\"Clear the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clientlogin-description','s:46:\"Log in to the wiki using the interactive flow.\";'),('en','messages:apihelp-clientlogin-example-login','s:112:\"Start the process of logging in to the wiki as user <kbd>Example</kbd> with password <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-clientlogin-example-login2','s:129:\"Continue logging in after a <samp>UI</samp> response for two-factor auth, supplying an <var>OATHToken</var> of <kbd>987654</kbd>.\";'),('en','messages:apihelp-compare-description','s:123:\"Get the difference between 2 pages.\n\nA revision number, a page title, or a page ID for both \"from\" and \"to\" must be passed.\";'),('en','messages:apihelp-compare-param-fromtitle','s:23:\"First title to compare.\";'),('en','messages:apihelp-compare-param-fromid','s:25:\"First page ID to compare.\";'),('en','messages:apihelp-compare-param-fromrev','s:26:\"First revision to compare.\";'),('en','messages:apihelp-compare-param-totitle','s:24:\"Second title to compare.\";'),('en','messages:apihelp-compare-param-toid','s:26:\"Second page ID to compare.\";'),('en','messages:apihelp-compare-param-torev','s:27:\"Second revision to compare.\";'),('en','messages:apihelp-compare-example-1','s:39:\"Create a diff between revision 1 and 2.\";'),('en','messages:apihelp-createaccount-description','s:26:\"Create a new user account.\";'),('en','messages:apihelp-createaccount-param-preservestate','s:349:\"If <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> returned true for <samp>hasprimarypreservedstate</samp>, requests marked as <samp>primary-required</samp> should be omitted. If it returned a non-empty value for <samp>preservedusername</samp>, that username must be used for the <var>username</var> parameter.\";'),('en','messages:apihelp-createaccount-example-create','s:95:\"Start the process of creating user <kbd>Example</kbd> with password <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-createaccount-param-name','s:9:\"Username.\";'),('en','messages:apihelp-createaccount-param-password','s:55:\"Password (ignored if <var>$1mailpassword</var> is set).\";'),('en','messages:apihelp-createaccount-param-domain','s:46:\"Domain for external authentication (optional).\";'),('en','messages:apihelp-createaccount-param-token','s:49:\"Account creation token obtained in first request.\";'),('en','messages:apihelp-createaccount-param-email','s:33:\"Email address of user (optional).\";'),('en','messages:apihelp-createaccount-param-realname','s:29:\"Real name of user (optional).\";'),('en','messages:apihelp-createaccount-param-mailpassword','s:67:\"If set to any value, a random password will be emailed to the user.\";'),('en','messages:apihelp-createaccount-param-reason','s:63:\"Optional reason for creating the accoun