er the output is volatile and should not be reused elsewhere within the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:32:\"The XML parse tree of the input.\";'),('en','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('en','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('en','messages:apihelp-expandtemplates-example-simple','s:68:\"Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('en','messages:apihelp-feedcontributions-description','s:34:\"Returns a user contributions feed.\";'),('en','messages:apihelp-feedcontributions-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedcontributions-param-user','s:40:\"What users to get the contributions for.\";'),('en','messages:apihelp-feedcontributions-param-namespace','s:47:\"Which namespace to filter the contributions by.\";'),('en','messages:apihelp-feedcontributions-param-year','s:24:\"From year (and earlier).\";'),('en','messages:apihelp-feedcontributions-param-month','s:25:\"From month (and earlier).\";'),('en','messages:apihelp-feedcontributions-para