nt.\";'),('en','messages:apihelp-filerevert-param-archivename','s:42:\"Archive name of the revision to revert to.\";'),('en','messages:apihelp-filerevert-example-revert','s:77:\"Revert <kbd>Wiki.png</kbd> to the version of <kbd>2011-03-05T15:27:40Z</kbd>.\";'),('en','messages:apihelp-help-description','s:39:\"Display help for the specified modules.\";'),('en','messages:apihelp-help-param-modules','s:159:\"Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('en','messages:apihelp-help-param-submodules','s:48:\"Include help for submodules of the named module.\";'),('en','messages:apihelp-help-param-recursivesubmodules','s:40:\"Include help for submodules recursively.\";'),('en','messages:apihelp-help-param-helpformat','s:26:\"Format of the help output.\";'),('en','messages:apihelp-help-param-wrap','s:53:\"Wrap the output in a standard API response structure.\";'),('en','messages:apihelp-help-param-toc','s:47:\"Include a table of contents in the HTML output.\";'),('en','messages:apihelp-help-example-main','s:25:\"Help for the main module.\";'),('en','messages:apihelp-help-example-submodules','s:56:\"Help for <kbd>action=query</kbd> and all its submodules.\";'),('en','messages:apihelp-help-example-recursive','s:21:\"All help in one page.\";'),('en','messages:apihelp-help-example-help','s:32:\"Help for the help module itself.\";'),('en','messages:apihelp-help-example-query','s:30:\"Help for two query submodules.\";'),('en','messages:apihelp-imagerotate-description','s:26:\"Rotate one or more images.\";'),('en','messages:apihelp-imagerotate-param-rotation','s:34:\"Degrees to rotate image clockwise.\";'),('en','messages:apihelp-imagerotate-param-tags','s:45:\"Tags to apply to the entry in the upload log.\";'),('en','messages:apihelp-imagerotate-example-simple','s:60:\"Rotate <kbd>File:Example.png</kbd> by <kbd>90</kbd> degrees.\";'),('en','messages:apihelp-imag