swords]]; use for main-account login is deprecated and may fail without warning. To safely log in to the main account, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('en','messages:apihelp-login-description-nobotpasswords','s:180:\"Log in and get authentication cookies.\n\nThis action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('en','messages:apihelp-login-param-name','s:10:\"User name.\";'),('en','messages:apihelp-login-param-password','s:9:\"Password.\";'),('en','messages:apihelp-login-param-domain','s:18:\"Domain (optional).\";'),('en','messages:apihelp-login-param-token','s:38:\"Login token obtained in first request.\";'),('en','messages:apihelp-login-example-gettoken','s:23:\"Retrieve a login token.\";'),('en','messages:apihelp-login-example-login','s:7:\"Log in.\";'),('en','messages:apihelp-logout-description','s:31:\"Log out and clear session data.\";'),('en','messages:apihelp-logout-example-logout','s:25:\"Log the current user out.\";'),('en','messages:apihelp-managetags-description','s:49:\"Perform management tasks relating to change tags.\";'),('en','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('en','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('en','messages:apihelp-managetags-param-reason','s:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),('en','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),('en','messages:apihelp-managetags-param-tags','s:60:\"Change tags to apply to the entry in the tag management log.\";'),('en','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('en','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('en','messages:apihelp-mergehistory-description','s:21:\"Merge page histories.\";'),('en','messages:apihelp-mergehistory-param-from','s:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-mergehistory-param-fromid','s:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-mergehistory-param-to','s:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('en','messages:apihelp-mergehistory-param-toid','s:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('en','messages:apihelp-mergehistory-param-timestamp','s:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('en','messages:apihelp-mergehistory-param-reason','s:29:\"Reason for the history merge.\";'),('en','messages:apihelp-mergehistory-example-merge','s:71:\"Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),('en','messages:apihelp-mergehistory-example-merge-timestamp','s:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('en','messages:apihelp-move-description','s:12:\"Move a page.\";'),('en','messages:apihelp-move-param-from','s:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-move-param-fromid','s:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-move-param-to','s:28:\"Title to rename the page to.\";'),('en','messages:apihelp-move-param-reason','s:22:\"Reason for the rename.\";'),('en','messages:apihelp-move-param-movetalk','s:35:\"Rename the talk page, if it exists.\";'),('en','messages:apihelp-move-param-movesubpages','s:31:\"Rename subpages, if applicable.\";'),('en','messages:apihelp-move-param-noredirect','s:24:\"Don\'t create a redirect.\";'),('en','messages:apihelp-move-param-watch','s:62:\"Add the page and the redirect to the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-unwatch','s:67:\"Remove the page and the redirect from the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-move-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-move-param-tags','s:99:\"Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),('en','messages:apihelp-move-example-move','s:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),('en','messages:apihelp-opensearch-description','s:46:\"Search the wiki using the OpenSearch protocol.\";'),('en','messages:apihelp-opensearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-opensearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-opensearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-opensearch-param-suggest','s:121:\"Do nothing if <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> is false.\";'),('en','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('en','messages:apihelp-opensearch-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('en','messages:apihelp-opensearch-example-te','s:40:\"Find pages beginning with <kbd>Te</kbd>.\";'),('en','messages:apihelp-options-description','s:224:\"Change preferences of the current user.\n\nOnly options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('en','messages:apihelp-options-param-reset','s:40:\"Resets preferences to the site defaults.\";'),('en','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('en','messages:apihelp-options-param-change','s:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),('en','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('en','messages:apihelp-options-param-optionvalue','s:62:\"The value for the option specified by <var>$1optionname</var>.\";'),('en','messages:apihelp-options-example-reset','s:22:\"Reset all preferences.\";'),('en','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('en','messages:apihelp-options-example-complex','s:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),('en','messages:apihelp-paraminfo-description','s:37:\"Obtain information about API modules.\";'),('en','messages:apihelp-paraminfo-param-modules','s:241:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),('en','messages:apihelp-paraminfo-param-helpformat','s:23:\"Format of help strings.\";'),('en','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('en','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('en','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('en','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('en','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('en','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('en','messages:apihelp-parse-description','s:523:\"Parses content and returns parser output.\n\nSee the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('en','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('en','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('en','messages:apihelp-parse-param-summary','s:17:\"Summary to parse.\";'),('en','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('en','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),('en','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('en','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('en','messages:apihelp-parse-param-prop','s:35:\"Which pieces of information to get:\";'),('en','messages:apihelp-parse-paramvalue-prop-text','s:38:\"Gives the parsed text of the wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-langlinks','s:48:\"Gives the language links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-categories','s:44:\"Gives the categories in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:41:\"Gives the HTML version of the categories.\";'),('en','messages:apihelp-parse-paramvalue-prop-links','s:48:\"Gives the internal links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-templates','s:43:\"Gives the templates in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-images','s:40:\"Gives the images in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-externallinks','s:48:\"Gives the external links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-sections','s:42:\"Gives the sections in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-revid','s:40:\"Adds the revision ID of the parsed page.\";'),('en','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-headitems','s:116:\"<span class=\"apihelp-deprecated\">Deprecated.</span> Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-headhtml','s:51:\"Gives parsed <code>&lt;head&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-modules','s:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),('en','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-wikitext','s:44:\"Gives the original wikitext that was parsed.\";'),('en','messages:apihelp-parse-paramvalue-prop-properties','s:56:\"Gives various properties defined in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('en','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:55:\"Gives the warnings that occurred while parsing content.\";'),('en','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('en','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('en','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('en','messages:apihelp-parse-param-section','s:227:\"Only parse the content of this section number.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),('en','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('en','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('en','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),('en','messages:apihelp-parse-param-disableeditsection','s:47:\"Omit edit section links from the parser output.\";'),('en','messages:apihelp-parse-param-disabletidy','s:57:\"Do not run HTML cleanup (e.g. tidy) on the parser output.\";'),('en','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('en','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),('en','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('en','messages:apihelp-parse-param-disabletoc','s:33:\"Omit table of contents in output.\";'),('en','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-example-page','s:13:\"Parse a page.\";'),('en','messages:apihelp-parse-example-text','s:15:\"Parse wikitext.\";'),('en','messages:apihelp-parse-example-texttitle','s:42:\"Parse wikitext, specifying the page title.\";'),('en','messages:apihelp-parse-example-summary','s:16:\"Parse a summary.\";'),('en','messages:apihelp-patrol-description','s:26:\"Patrol a page or revision.\";'),('en','messages:apihelp-patrol-param-rcid','s:27:\"Recentchanges ID to patrol.\";'),('en','messages:apihelp-patrol-param-revid','s:22:\"Revision ID to patrol.\";'),('en','messages:apihelp-patrol-param-tags','s:52:\"Change tags to apply to the entry in the patrol log.\";'),('en','messages:apihelp-patrol-example-rcid','s:23:\"Patrol a recent change.\";'),('en','messages:apihelp-patrol-example-revid','s:18:\"Patrol a revision.\";'),('en','messages:apihelp-protect-description','s:38:\"Change the protection level of a page.\";'),('en','messages:apihelp-protect-param-title','s:72:\"Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-protect-param-pageid','s:68:\"ID of the page to (un)protect. Cannot be used together with $1title.\";'),('en','messages:apihelp-protect-param-protections','s:262:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('en','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('en','messages:apihelp-protect-param-reason','s:26:\"Reason for (un)protecting.\";'),('en','messages:apihelp-protect-param-tags','s:56:\"Change tags to apply to the entry in the protection log.\";'),('en','messages:apihelp-protect-param-cascade','s:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),('en','messages:apihelp-protect-param-watch','s:73:\"If set, add the page being (un)protected to the current user\'s watchlist.\";'),('en','messages:apihelp-protect-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-protect-example-protect','s:15:\"Protect a page.\";'),('en','messages:apihelp-protect-example-unprotect','s:105:\"Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),('en','messages:apihelp-protect-example-unprotect2','s:44:\"Unprotect a page by setting no restrictions.\";'),('en','messages:apihelp-purge-description','s:37:\"Purge the cache for the given titles.\";'),('en','messages:apihelp-purge-param-forcelinkupdate','s:24:\"Update the links tables.\";'),('en','messages:apihelp-purge-param-forcerecursivelinkupdate','s:99:\"Update the links table, and update the links tables for any page that uses this page as a template.\";'),('en','messages:apihelp-purge-example-simple','s:59:\"Purge the <kbd>Main Page</kbd> and the <kbd>API</kbd> page.\";'),('en','messages:apihelp-purge-example-generator','s:47:\"Purge the first 10 pages in the main namespace.\";'),('en','messages:apihelp-query-description','s:147:\"Fetch data from and about MediaWiki.\n\nAll data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('en','messages:apihelp-query-param-prop','s:46:\"Which properties to get for the queried pages.\";'),('en','messages:apihelp-query-param-list','s:19:\"Which lists to get.\";'),('en','messages:apihelp-query-param-meta','s:22:\"Which metadata to get.\";'),('en','messages:apihelp-query-param-indexpageids','s:68:\"Include an additional pageids section listing all returned page IDs.\";'),('en','messages:apihelp-query-param-export','s:61:\"Export the current revisions of all given or generated pages.\";'),('en','messages:apihelp-query-param-exportnowrap','s:127:\"Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('en','messages:apihelp-query-param-iwurl','s:62:\"Whether to get the full URL if the title is an interwiki link.\";'),('en','messages:apihelp-query-param-rawcontinue','s:61:\"Return raw <samp>query-continue</samp> data for continuation.\";'),('en','messages:apihelp-query-example-revisions','s:125:\"Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query-example-allpages','s:56:\"Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('en','messages:apihelp-query+allcategories-description','s:25:\"Enumerate all categories.\";'),('en','messages:apihelp-query+allcategories-param-from','s:39:\"The category to start enumerating from.\";'),('en','messages:apihelp-query+allcategories-param-to','s:36:\"The category to stop enumerating at.\";'),('en','messages:apihelp-query+allcategories-param-prefix','s:58:\"Search for all category titles that begin with this value.\";'),('en','messages:apihelp-query+allcategories-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allcategories-param-min','s:55:\"Only return categories with at least this many members.\";'),('en','messages:apihelp-query+allcategories-param-max','s:54:\"Only return categories with at most this many members.\";'),('en','messages:apihelp-query+allcategories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+allcategories-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-size','s:37:\"Adds number of pages in the category.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+allcategories-example-size','s:64:\"List categories with information on the number of pages in each.\";'),('en','messages:apihelp-query+allcategories-example-generator','s:86:\"Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-description','s:55:\"List all deleted revisions by a user or in a namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-useronly','s:40:\"May only be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-nonuseronly','s:38:\"Cannot be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:275:\"<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases,