ision content (requires $1prop=content; replaced by <kbd>$1prop=parsetree</kbd>).\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:124:\"Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:151:\"Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:187:\"Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:110:\"Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+search-description','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+search-param-search','s:175:\"Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-param-info','s:25:\"Which metadata to return.\";'),('en','messages:apihelp-query+search-param-prop','s:27:\"Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:61:\"Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:32:\"Adds the word count of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:52:\"Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:34:\"Adds a parsed snippet of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:40:\"Adds a parsed snippet of the page title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:44:\"Adds a parsed snippet of the redirect title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:40:\"Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:52:\"Adds a parsed snippet of the matching section title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:39:\"Adds the title of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:47:\"Adds a parsed snippet of the matching category.\";'),('en','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:61:\"Adds a boolean indicating if the search matched file content.\";'),('en','messages:apihelp-query+search-paramvalue-prop-score','s:63:\"<span class=\"apihelp-deprecated\">Deprecated and ignored.</span>\";'),('en','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:63:\"<span class=\"apihelp-deprecated\">Deprecated and ignored.</span>\";'),('en','messages:apihelp-query+search-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+search-param-interwiki','s:54:\"Include interwiki results in the search, if available.\";'),('en','messages:apihelp-query+search-param-backe