jobs may be slightly inaccurate or contains failed attempts, please consult the [https://www.mediawiki.org/wiki/Manual:Job_queue manual] for further information.\";'),('en','messages:smw-admin-statistics-querycache-title','s:22:\"Query cache statistics\";'),('en','messages:smw-admin-statistics-querycache-disabled','s:141:\"The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and hereby no statistics are available.\";'),('en','messages:smw-admin-statistics-querycache-explain','s:869:\"The cache statistics is to contain provisional cumulative as well as derived data including: \n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval \n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency) \n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources \n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process  \n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),('en','messages:smw-admin-permission-missing','s:210:\"The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),('en','messages:smw-admin-setupsuccess','s:30:\"The storage engine was set up.\";'),('en','messages:smw_smwadmin_return','s:12:\"Return to $1\";'),('en','messages:smw_smwadmin_updatestarted','s:188:\"A new update process for refreshing the semantic data was started.\nAll stored data will be rebuilt or repaired where needed.\nYou can follow the progress of the update on this special page.\";'),('en','messages:smw_smwadmin_updatenotstarted','s:69:\"There is already an update process running.\nNot creating another one.\";'),('en','messages:smw_smwadmin_updatestopped','s:48:\"All existing update processes have been stopped.\";'),('en','messages:smw_smwadmin_updatenotstopped','s:104:\"To stop the running update process, you must activate the checkbox to indicate that you are really sure.\";'),('en','messages:smw-admin-docu','s:311:\"This special page helps you during installation, upgrade, maintenance and usage of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a> and also provides further administrative functions and tasks as well as statistics.\nRemember to back up valuable data before executing administrative functions.\";'),('en','messages:smw-admin-db','s:33:\"Database installation and upgrade\";'),('en','messages:smw-admin-dbdocu','s:419:\"Semantic MediaWiki requires some extensions to the MediaWiki database in order to store the semantic data.\nThe below function ensures that your database is set up properly.\nThe changes made in this step do not affect the rest of the MediaWiki database, and can easily be undone if desired.\nThis setup function can be executed multiple times without doing any harm, but it is needed only once on installation or upgrade.\";'),('en','messages:smw-admin-permissionswarn','s:432:\"If the operation fails with SQL errors, the database user employed by your wiki (check your \"LocalSettings.php\" file) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in the \"LocalSettings.php\" file, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),('en','messages:smw-admin-dbbutton','s:28:\"Initialize or upgrade tables\";'),('en','messages:smw-admin-announce','s:18:\"Announce your wiki\";'),('en','messages:smw-admin-announce-text','s:119:\"If your wiki is public, you can register it on <a href=\"https://wikiapiary.com\">WikiApiary</a>, the wiki tracking wiki.\";'),('en','messages:smw-admin-deprecation-notice-title','s:19:\"Deprecation notices\";'),('en','messages:smw-admin-deprecation-notice-docu','s:206:\"The following section contains settings that have been deprecated or removed but were detected to be active on this wiki. It is expected that any future release will remove support for these configurations.\";'),('en','messages:smw-admin-deprecation-notice-config-notice','s:105:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> is deprecated and will be removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-replacement','s:147:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was replaced by <code>[https://www.semantic-mediawiki.org/wiki/Help:$2 $2]</code>\";'),('en','messages:smw-admin-deprecation-notice-config-removal','s:83:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was removed in $2\";'),('en','messages:smw-admin-deprecation-notice-title-notice','s:6:\"Notice\";'),('en','messages:smw-admin-deprecation-notice-title-replacement','s:11:\"Replacement\";'),('en','messages:smw-admin-deprecation-notice-title-removal','s:7:\"Removal\";'),('en','messages:smw-smwadmin-refresh-title','s:22:\"Data repair and update\";'),('en','messages:smw_smwadmin_datarefresh','s:12:\"Data rebuild\";'),('en','messages:smw_smwadmin_datarefreshdocu','s:450:\"It is possible to restore all Semantic MediaWiki data based on the current contents of the wiki.\nThis can be useful to repair broken data or to refresh the data if the internal format has changed due to some software upgrade.\nThe update is executed page by page and will not be completed immediately.\nThe following shows if an update is in progress and allows you to start or stop updates (unless this feature was disabled by the site administrator).\";'),('en','messages:smw_smwadmin_datarefreshprogress','s:428:\"<strong>An update is already in progress.</strong>\nIt is normal that the update progresses only slowly since it only refreshes data in small chunks each time a user accesses the wiki.\nTo finish this update more quickly, you can invoke the MediaWiki maintenance script <code>runJobs.php</code> (use the option <code>--maxjobs 1000</code> to restrict the number of updates done in one batch).\nEstimated progress of current update:\";'),('en','messages:smw_smwadmin_datarefreshbutton','s:19:\"Start updating data\";'),('en','messages:smw_smwadmin_datarefreshstop','s:16:\"Stop this update\";'),('en','messages:smw_smwadmin_datarefreshstopconfirm','s:29:\"Yes, I am {{GENDER:$1|sure}}.\";'),('en','messages:smw-admin-job-scheduler-note','s:274:\"Most activities are scheduled as job in order for tasks to be performed as batch with the job scheduler to plan and complete the processing therefore it is critical that the maintenance script <code>runJobs.php</code> or <code>$wgRunJobsAsync</code> are managed accordingly.\";'),('en','messages:smw-admin-outdateddisposal-title','s:26:\"Outdated entities disposal\";'),('en','messages:smw-admin-outdateddisposal-intro','s:279:\"Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),('en','messages:smw-admin-outdateddisposal-active','s:50:\"An outdated entities disposal job has been queued.\";'),('en','messages:smw-admin-outdateddisposal-button','s:17:\"Schedule disposal\";'),('en','messages:smw-admin-feature-disabled','s:197:\"This feature has been disabled on this wiki, please consult the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">settings</a> help page or contact the system administrator.\";'),('en','messages:smw-admin-propertystatistics-title','s:27:\"Property statistics rebuild\";'),('en','messages:smw-admin-propertystatistics-intro','s:177:\"Rebuilds the entire property usage statistics and therein updates and corrects the [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count] of properties.\";'),('en','messages:smw-admin-propertystatistics-active','s:41:\"A statistics rebuild job has been queued.\";'),('en','messages:smw-admin-propertystatistics-button','s:27:\"Schedule statistics rebuild\";'),('en','messages:smw-admin-fulltext-title','s:24:\"Full-text search rebuild\";'),('en','messages:smw-admin-fulltext-intro','s:280:\"Rebuilds the search index from property tables with an enabled [https://www.semantic-mediawiki.org/wiki/Full-text full-text search] datatype. Changes to the index rules (altered stopwords, new stemmer etc.) and/or a newly added or altered table does require to run this job again.\";'),('en','messages:smw-admin-fulltext-active','s:47:\"A full-text search rebuild job has been queued.\";'),('en','messages:smw-admin-fulltext-button','s:26:\"Schedule full-text rebuild\";'),('en','messages:smw-admin-support','s:15:\"Getting support\";'),('en','messages:smw-admin-supportdocu','s:53:\"Various resources might help you in case of problems:\";'),('en','messages:smw-admin-installfile','s:201:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL file</a>.\";'),('en','messages:smw-admin-smwhomepage','s:139:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw-admin-bugsreport','s:107:\"Bugs can be reported to <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a>.\";'),('en','messages:smw-admin-questions','s:184:\"If you have further questions or suggestions, join the discussion on <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">Semantic MediaWiki user mailing list</a>.\";'),('en','messages:smw-admin-supplementary-section-title','s:23:\"Supplementary functions\";'),('en','messages:smw-admin-supplementary-section-intro','s:107:\"Some of the listed functions in this section may be restricted and therefore are inaccessible on this wiki.\";'),('en','messages:smw-admin-supplementary-settings-title','s:22:\"Configuration settings\";'),('en','messages:smw-admin-supplementary-settings-intro','s:84:\"<u>$1</u> outputs a collective list of available settings used in Semantic MediaWiki\";'),('en','messages:smw-admin-supplementary-operational-statistics-title','s:22:\"Operational statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-intro','s:48:\"<u>$1</u> displays an extended set of statistics\";'),('en','messages:smw-admin-supplementary-idlookup-title','s:29:\"Object ID lookup and disposal\";'),('en','messages:smw-admin-supplementary-idlookup-intro','s:66:\"<u>$1</u> contains functions to lookup and dispose individual ID\'s\";'),('en','messages:smw-property-label-similarity-title','s:32:\"Property label similarity report\";'),('en','messages:smw-property-label-similarity-intro','s:61:\"<u>$1</u> calculates similarties for existing property labels\";'),('en','messages:smw-property-label-similarity-threshold','s:10:\"Threshold:\";'),('en','messages:smw-property-label-similarity-type','s:15:\"Display Type ID\";'),('en','messages:smw-property-label-similarity-noresult','s:47:\"No results were found for the selected options.\";'),('en','messages:smw-property-label-similarity-docu','s:522:\"Compares and reports the [https://www.semantic-mediawiki.org/wiki/Property_similarity syntactic similarity] (not the semantic similarity) between two property labels which may help filter misspelled or equivalent properties that represent the same concept (see special page [[Special:Properties|Properties]] to clarify concept and usage of reported properties). The threshold can be adjusted to either widen or narrow the similarity distance. <code>[[Property:$1|$1]]</code> is used to exempt properties from the analysis.\";'),('en','messages:smw-admin-operational-statistics','s:194:\"This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),('en','messages:smw_adminlinks_datastructure','s:14:\"Data structure\";'),('en','messages:smw_adminlinks_displayingdata','s:12:\"Data display\";'),('en','messages:smw_adminlinks_inlinequerieshelp','s:19:\"Inline queries help\";'),('en','messages:smw-page-indicator-usage-count','s:113:\"Estimated [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count]: {{PLURAL:$2|\'\'\'$2\'\'\'}}\";'),('en','messages:smw-property-indicator-type-info','s:42:\"{{PLURAL:$1|User|System}} defined property\";'),('en','messages:smw-property-indicator-last-count-update','s:38:\"Estimated usage count\nLast updated: $1\";'),('en','messages:smw-createproperty-isproperty','s:28:\"It is a property of type $1.\";'),('en','messages:smw-createproperty-allowedvals','s:82:\"The allowed {{PLURAL:$1|value for this property is|values for this property are}}:\";'),('en','messages:smw-paramdesc-category-delim','s:13:\"The delimiter\";'),('en','messages:smw-paramdesc-category-template','s:35:\"A template to format the items with\";'),('en','messages:smw-paramdesc-category-userparam','s:35:\"A parameter to pass to the template\";'),('en','messages:smw-info-par-message','s:19:\"Message to display.\";'),('en','messages:smw-info-par-icon','s:41:\"Icon to show, either \"info\" or \"warning\".\";'),('en','messages:prefs-smw','s:18:\"Semantic MediaWiki\";'),('en','messages:prefs-ask-options','s:23:\"Semantic search options\";'),('en','messages:smw-prefs-intro-text','s:295:\"Options below are provided by [https://www.semantic-mediawiki.org/ Semantic MediaWiki] (or related extensions) to enable individual customization on selected functions. For more information, please have a look at this [https://www.semantic-mediawiki.org/wiki/Help:User_preferences help section].\";'),('en','messages:smw-prefs-ask-options-tooltip-display','s:41:\"Display parameter text as an info tooltip\";'),('en','messages:smw-prefs-ask-options-collapsed-default','s:44:\"Enable option box to be collapsed by default\";'),('en','messages:smw-ui-tooltip-title-property','s:8:\"Property\";'),('en','messages:smw-ui-tooltip-title-quantity','s:15:\"Unit conversion\";'),('en','messages:smw-ui-tooltip-title-info','s:11:\"Information\";'),('en','messages:smw-ui-tooltip-title-service','s:13:\"Service links\";'),('en','messages:smw-ui-tooltip-title-warning','s:5:\"Error\";'),('en','messages:smw-ui-tooltip-title-parameter','s:9:\"Parameter\";'),('en','messages:smw-ui-tooltip-title-event','s:5:\"Event\";'),('en','messages:smw-ui-tooltip-title-note','s:4:\"Note\";'),('en','messages:smw-ui-tooltip-title-legend','s:6:\"Legend\";'),('en','messages:smw-ui-tooltip-title-reference','s:9:\"Reference\";'),('en','messages:smw_unknowntype','s:36:\"The type of this property is invalid\";'),('en','messages:smw-concept-cache-text','s:84:\"The concept has a total of $1 {{PLURAL:$1|page|pages}}, and was last updated $3, $2.\";'),('en','messages:smw_concept_header','s:21:\"Pages of concept \"$1\"\";'),('en','messages:smw_conceptarticlecount','s:42:\"Showing below $1 {{PLURAL:$1|page|pages}}.\";'),('en','messages:smw-qp-empty-data','s:82:\"Requested data could not be displayed due to some insufficient selection criteria.\";'),('en','messages:right-smw-admin','s:48:\"Access administration tasks (Semantic MediaWiki)\";'),('en','messages:right-smw-patternedit','s:85:\"Edit access to maintain allowed regular expressions and patterns (Semantic MediaWiki)\";'),('en','messages:right-smw-pageedit','s:83:\"Edit access for <code>Is edit protected</code> annotated pages (Semantic MediaWiki)\";'),('en','messages:action-smw-patternedit','s:51:\"edit regular expressions used by Semantic MediaWiki\";'),('en','messages:action-smw-pageedit','s:77:\"edit pages annotated with <code>Is edit protected</code> (Semantic MediaWiki)\";'),('en','messages:group-smwadministrator','s:35:\"Administrators (Semantic MediaWiki)\";'),('en','messages:group-smwadministrator-member','s:48:\"{{GENDER:$1|administrator (Semantic MediaWiki)}}\";'),('en','messages:grouppage-smwadministrator','s:50:\"{{ns:project}}:Administrators (Semantic MediaWiki)\";'),('en','messages:group-smwcurator','s:29:\"Curators (Semantic MediaWiki)\";'),('en','messages:group-smwcurator-member','s:42:\"{{GENDER:$1|curator (Semantic MediaWiki)}}\";'),('en','messages:grouppage-smwcurator','s:44:\"{{ns:project}}:Curators (Semantic MediaWiki)\";'),('en','messages:action-smw-admin','s:46:\"access Semantic MediaWiki administration tasks\";'),('en','messages:smw-pa-property-predefined-default','s:30:\"\"$1\" is a predefined property.\";'),('en','messages:smw-pa-property-predefined-common','s:290:\"This property is pre-deployed (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) and comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),('en','messages:smw-pa-property-predefined_ask','s:269:\"\"$1\" is a predefined property that represents meta information (in form of a [https://www.semantic-mediawiki.org/wiki/Subobject subobject]) about individual queries and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_asksi','s:189:\"\"$1\" is a predefined property that collects the number of conditions used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askde','s:174:\"\"$1\" is a predefined property that informs about the depth of a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined-long_askde','s:271:\"It is a numerical value computed on the basis of subquery nesting, property chains, and available description elements with the execution of a query being restricted by the <code>[https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth $smwgQMaxDepth]</code> setting.\";'),('en','messages:smw-pa-property-predefined_askpa','s:186:\"\"$1\" is a predefined property describing parameters that influence a query result and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined-long_askpa','s:132:\"It is part of a collection of properties that specify a [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler query profile].\";'),('en','messages:smw-sp-properties-docu','s:454:\"This page lists [https://www.semantic-mediawiki.org/wiki/Property properties] and their usage counts available for this wiki. For up-to-date count statistics it is recommended that the [https://www.semantic-mediawiki.org/wiki/rebuildPropertyStatistics property statistics] maintenance script is run on a regular basis. For a differentiated view, see the [[Special:UnusedProperties|unused]] or [[Special:WantedProperties|wanted properties]] special pages.\";'),('en','messages:smw-sp-properties-cache-info','s:123:\"The listed data have been retrieved from [https://www.semantic-mediawiki.org/wiki/Caching cache], and were last updated $1.\";'),('en','messages:smw-sp-properties-header-label','s:18:\"List of properties\";'),('en','messages:smw-admin-settings-docu','s:251:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-sp-admin-settings-button','s:22:\"Generate settings list\";'),('en','messages:smw-admin-idlookup-title','s:16:\"Object ID lookup\";'),('en','messages:smw-admin-idlookup-docu','s:221:\"Request details about an internal object ID that represents an individual entity (wikipage, subobject, property etc.) in Semantic MediaWiki. The ID should not be mistaken to be the same as MediaWiki\'s page or revision ID.\";'),('en','messages:smw-admin-iddispose-title','s:18:\"Object ID disposal\";'),('en','messages:smw-admin-iddispose-docu','s:278:\"The disposal operation is unrestricted and will remove an internal object ID from the storage engine, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),('en','messages:smw-admin-iddispose-done','s:45:\"ID \"$1\" was removed from the storage backend.\";'),('en','messages:smw-admin-iddispose-references','s:73:\"{{PLURAL:$2|Table|Tables}} with at least one active reference to ID \"$1\".\";'),('en','messages:smw-admin-objectid','s:10:\"Object ID:\";'),('en','messages:smw-livepreview-loading','s:10:\"Loading...\";'),('en','messages:smw-sp-searchbyproperty-description','s:313:\"This page provides a simple [https://www.semantic-mediawiki.org/wiki/Help:Browsing_interfaces browsing interface] for finding entities described by a property and a named value. Other available search interfaces include the [[Special:PageProperty|page property search]], and the [[Special:Ask|ask query builder]].\";'),('en','messages:smw-sp-searchbyproperty-resultlist-header','s:15:\"List of results\";'),('en','messages:smw-sp-searchbyproperty-nonvaluequery','s:54:\"A list of values that have the property \"$1\" assigned.\";'),('en','messages:smw-sp-searchbyproperty-valuequery','s:66:\"A list of pages that have property \"$1\" with value \"$2\" annotated.\";'),('en','messages:smw-datavalue-number-textnotallowed','s:65:\"\"$1\" can not be assigned to a declared number type with value $2.\";'),('en','messages:smw-datavalue-number-nullnotallowed','s:59:\"\"$1\" returned with a \"NULL\" which is not allowed as number.\";'),('en','messages:smw-editpage-annotation-enabled','s:559:\"This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help pages.\";'),('en','messages:smw-editpage-annotation-disabled','s:236:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace can be found on the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-property-annotation-enabled','s:472:\"This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:259:\"This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),('en','messages:smw-editpage-concept-annotation-enabled','s:189:\"This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),('en','messages:log-name-smw','s:22:\"Semantic MediaWiki log\";'),('en','messages:log-show-hide-smw','s:25:\"$1 Semantic MediaWiki log\";'),('en','messages:log-description-smw','s:155:\"Activities for [https://www.semantic-mediawiki.org/wiki/Help:Logging enabled event types] that have been reported by Semantic MediaWiki and its components.\";'),('en','messages:logentry-smw-maintenance','s:56:\"Maintenance related events emitted by Semantic MediaWiki\";'),('en','messages:smw-datavalue-import-unknown-namespace','s:121:\"The import namespace \"$1\" is unknown. Please ensure that OWL import details are available via [[MediaWiki:Smw import $1]]\";'),('en','messages:smw-datavalue-import-missing-namespace-uri','s:81:\"Unable to find a \"$1\" namespace URI in the [[MediaWiki:Smw import $1|$1 import]].\";'),('en','messages:smw-datavalue-import-missing-type','s:83:\"No type definition was found for \"$1\" in the [[MediaWiki:Smw import $2|$2 import]].\";'),('en','messages:smw-datavalue-import-link','s:37:\"[[MediaWiki:Smw import $1|$1 import]]\";'),('en','messages:smw-datavalue-import-invalid-value','s:101:\"\"$1\" is not a valid format and is expected to consist of \"namespace\":\"identifier\" (e.g. \"foaf:name\").\";'),('en','messages:smw-datavalue-import-invalid-format','s:89:\"Expected the string \"$1\" to be divided into four parts but the format was not understood.\";'),('en','messages:smw-pa-property-predefined_impo','s:251:\"\"$1\" is a predefined property that describes a relation to an [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_type','s:194:\"\"$1\" is a predefined property that describes the [[Special:Types|datatype]] of a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_sobj','s:226:\"\"$1\" is a predefined property representing a [https://www.semantic-mediawiki.org/wiki/Help:Container container] construct and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined-long_sobj','s:180:\"The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),('en','messages:smw-pa-property-predefined_errp','s:275:\"\"$1\" is a predefined property to track input errors for irregular value annotations that was likely caused by type or [[Property:Allows value|allowed value]] restrictions and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_pval','s:301:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value \"$1\"] is a predefined property that can define a list of permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_pvali','s:330:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org