INSERT INTO `text` VALUES (1,'<strong>MediaWiki has been successfully installed.</strong>\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(2,'MediaWiki, Semantic MediaWiki and RDFIO successfully installed!\n\nNow please follow these steps:\n\n# First [[Special:UserLogin|log in to the wiki]] (user Admin, pass changethis).\n# Please go to the [[Special:RDFIOAdmin|RDFIO Admin Special Page]] and ensure that the ARC2 store is properly set up.\n# Go to the [[Special:RDFImport|RDF Import Special Page]], click \"Paste RDF\", and then \"RDFXML example data\" under the text field, and import it.\n# GO to [[Special:RecentChanges|Recent Changes]], to see if you got some newly imported data.\n# Finally, go to the [[Special:SPARQLEndpoint|SPARQL Endpoint]] and execute the example query, and see if you can see the example data show up!','utf-8'),(3,'* navigation\n** mainpage|mainpage-description\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n** helppage|help\n* Semantic Tools\n** Special:RDFIOAdmin|RDFIO Admin\n** Special:RDFImport|RDF Import\n** Special:SPARQLEndpoint|SPARQL Endpoint\n** Special:SPARQLImport|SPARQL Import\n** Special:Categories|Categories\n** Special:Properties|Properties\n* SEARCH\n* TOOLBOX\n* LANGUAGES','utf-8'),(4,'http://www.w3.org/2004/02/skos/core#|[http://www.w3.org/TR/skos-reference/skos.rdf Simple Knowledge Organization System (SKOS)]\n altLabel|Type:Monolingual text\n broader|Type:Annotation URI\n broaderTransitive|Type:Annotation URI\n b